import { Card, ListGroup } from "react-bootstrap";
import { Link, useNavigate, useParams } from "react-router-dom"

function ParamsInfo({ data }) {
    const params = useParams()
    console.log(data);
    const navigate = useNavigate()
    const backToGallary = ()=>{
        navigate('/gallary')
    }
    const filterdData = data.find((item) => {
        const id = +item.id
        console.log(id);
        return id === +(params.id)
    })
    console.log(filterdData);
    return (
        <div>
            <Card style={{ width: '18rem' }}>
                <img src={filterdData.img} />
                <Card.Body>
                    <Card.Title> ID :{filterdData.id}</Card.Title>
                    <Card.Title> Price :{filterdData.price}</Card.Title>
                    <Card.Text>
                        {filterdData.discription}
                    </Card.Text>
                </Card.Body>
            </Card>
           <button onClick={backToGallary}>Back to gallary</button>
        </div>
    )
}
export default ParamsInfo
